    false,nt"url": null,nt"notes": "This is a heatmap (a graphical representation
    of data where the individual values contained in a matrix are represented as colors)
    of 2013 deer hunt kills within the California Department of Fish & Wildlife (CDFW)
    North Central Region (Region 2). The data was compiled from 2013 CDFW Automated
    Licensing Data System (ALDS) tables. Text descriptions from hunters were approximated
    and placed with geographic coordinates. The resulting point data was converted to
    a heatmap using Kernel Density Tool in ArcGIS 10.1",nt"license_title": null,nt"extras":
